import React from 'react'

export default function ImageGrid(props) {
    const imagePath = '/images/'

    const renderImages = () => {
        const { images } = props
        return images.map(image => <div className={'grid-item'}><image src={imagePath + image.thumbnail} /></div>)
    }

    return (
        <div>
            <div className={'gridContainer'}>
                {renderImages()}
            </div>
            <style jsx>{`
                .gridContainer{
                    display: grid;
                }
            `}</style>
        </div>
    )
}
